INSERT INTO `event` VALUES (212,'theatre','اوقات سگی',1.00,100000,NULL,9,NULL,'استاد دانشگاهی که به خاطر مسائلی از دانشگاه اخراج و خانه نشین شده است، در روز تولدش زنی ناشناس را در خانه خود میبیند','از همراه داشتن فرزندان زیر ۱۸ سال خودداری نمایید.'),(213,'theatre','کروکودیل',0.80,100000,NULL,9,NULL,'گذشته رو نمی‌شه تغییر داد، ولی هنوز زمان داریم آینده رو اونطوری که می‌خوایم عوضش کنیم.',NULL),(214,'theatre','کشتن گربه بابا فونتن',0.75,100000,20,9,NULL,'کشتن گربه بابا فونتن، برش کوتاهی از زندگی پسر نوجوانی به نام نعیم است که در دوران پس از انقلاب الجزایر در یک آسایشگاه روانی روایت میشود. نعیم در بحبوحه انقلاب، مونیک، دختری فرانسوی که در واقع عاشق او بوده است را تنها به جرم فرانسوی بودنش میکشد و در طول نمایشنامه در مواجهه با پرسشگر دائما در حال کتمان این مسئله است.',' از همراه داشتن فرزندان زیر ۱۵ سال خودداری نمایید.'),(215,'theatre','سینما کارون',1.00,80000,NULL,9,NULL,'من سینما کارونم.','از همراه داشتن فرزندان زیر 10 سال خودداری نمایید.'),(216,'theatre','خبرنگار بی خبر',0.50,60000,NULL,9,NULL,'فرد دست‌فروشی وارد کافه میشود و مسئول کافه برای خارج کردن او با چالشی روبه‌رو میشود.',NULL),(217,'theatre','اسکرین شات',1.20,200000,15,9,NULL,'از یک دوره همی شبانه تا نابودی چند خانواده','از همراه داشتن فرزندان زیر 12 سال خودداری نمایید.'),(218,'theatre','دامبوبو',0.75,60000,50,9,'توجه: شماره تماس از سوی گروه محترم اجرایی درج شده است و تیوال نقشی در عملکرد و پاسخدهی آن ندارد.','داستان درباره پسری ساده و خوش قلب به نام دامبوبو است که در مسیر بازگشت به خانه با اتفاقات و شخصیت های مختلفی روبرو میشود و...','از همراه داشتن فرزندان زیر 2 سال خودداری نمایید.'),(219,'concert','ساز و سرود',1.50,320000,NULL,9,NULL,NULL,NULL),(220,'concert','تکنوازی سه‌تار محمد صمدی',1.00,150000,NULL,9,'ترتیب گوشه‌ها و نغمات:\nبخش اول:\nگوشه اول: درآمد\nقطعه: بیات اصفهان استاد لطفی\nگوشه دوم: جامه‌دران\nقطعه: هی داد هی بیداد\nبخش دوم:\nاول: بداهه‌نوازی در بیات اصفهان\nدوم: قطعه‌ی ئامان هی ئامان','تکنوازی سه‌تار در آواز بیات اصفهان',' از همراه داشتن فرزندان زیر ۱۵ سال خودداری نمایید'),(221,'theatre_film','زنان بالکان',0.75,35000,NULL,9,'مناسب برای مخاطبان بالای ۱۰ سال','داستان نمایش در بحبوبه جنگ بین صربستان و بوسنی و در زندانی که صرب ها زنان اسیر شده بوسنیایی را در آنجا نگهداری می کنند اتفاق می افتد.',NULL),(222,'theatre_film','هر کسی یا روز می‌میرد یا شب من شبانه روز',0.50,14000,NULL,9,NULL,'هرکسی یا روز می میرد یا شب، من شبانه روز قصه این روزهای تمام ماست، تمام آن ها که در این خانه مانده اند و تمام آن ها که از این خانه رفته اند و تمام آن ها که به این خانه باز می گردند و ما تمام تلاشمان را می کنیم تا آن ها که دوستشان می داریم یک ثانیه هم که شده بیشتر روی پاهایشان بایستند، شبیه آواز غمگینی که از تو دعوت می کند تا پای جان با زندگیت برقصی.',NULL),(223,'Serie','گیسو',0.45,14000,NULL,NULL,NULL,'رضا در مخمصه‌ای افتاده که برای بیرون آمدن از آن به کمک سهیل و پیمان نیاز دارد. اما نقشه آن‌ها آن‌طور که باید پیش نمی‌رود و اتفاقاتی رخ می‌دهد که کنترل اوضاع را از دست همه خارج می‌کند و ...',NULL),(224,'Serie','آفتاب پرست',1.00,15000,NULL,NULL,NULL,'جمال و منوچ که عشق لاتی و سطح یک شدن در خفت‌گیری را دارند از بی عرضه‌گی و بدشانسی گیر پلیس می‌افتند و به زندان می‌روند. جمال در زندان به همه می‌گوید که در سطح یک فقط پورشه‌سوار خفت کرده‌اند و به همین خاطر به جمال پورشه معروف می‌شود و...',NULL),(225,'workshop','انیمیشن فیلشاه، مدل‌سازی',NULL,199000,NULL,NULL,'شما با خرید این مجموعه می‌توانید علاوه بر استفاده از ۴ دوره ضبط شده کارگردانی، تدوین، نورپردازی و کامپوزیت و مدلسازی و تکسچر در کلاس آنلاینی که با حضور هادی محمدیان، کارگردان انیمیشن «فیلشاه» جهت پرسش و پاسخ و رفع اشکال در تاریخ اوایل خرداد‌ماه برگزار می‌گردد، حضور یابید.','کارگاه انیمیشن سینمایی فیلشاه با تدریس هادی محمدیان، حسن ایوبی، علی دین‌جو و مهدی عبداللهی از گروه هنرپویا در زمینه‌های کارگردانی، تدوین، نورپردازی، کامپوزیت، مدلسازی و تکسچر در انیمیشن سه بعدی برگزار شده است.',NULL),(226,'course','حقوق برای همه',NULL,2400000,NULL,9,'«حقوق برای همه» عنوان دوره‌ای از درس‌گفتارهای حقوقی است که دانش حقوق را برای استفاده‌ی عموم گویاسازی کرده است.\nایشان در همین ترم، درس‌گفتار \"فلسفه‌ی حقوق\" را در ساعت 19 تا 21 ارائه کرده‌اند که این کلاس نیز از 29 بهمن آغاز می‌شود','۱۰ جلسه درس‌گفتار حضوری با دکتر محسن برهانی.',NULL),(227,'game','مافیا | دن کلاب مشهد (آبکوه)',1.50,40000,NULL,9,NULL,NULL,NULL),(228,'Surfing','ضیافت قابیل',NULL,100000,NULL,9,NULL,'در یک عمارت بزرگ چهار مرد و دو زن به ضیافت شامی دعوت شده اند، با شنیدن صدای ناقوس متوجه میشوند برای نجات جان خود باید...','از همراه داشتن فرزندان زیر ۱۲ سال خودداری نمایید'),(229,'Exhibition','دومین دوره آرت فیر تهران',NULL,70000,10,NULL,'ین نمایشگاه از ساعت ۱۵:۰۰ تا ۲۱:۰۰ در مرکز همایشهای رایزن برگزار می‌شود.\nبزرگترین نمایشگاه هنر درایران در دوره ی قبلی میزبان بیش از ۵ هزار هنرمند و هنردوست بود.\nاین رویداد هرساله با برگزاری گروه هنری نگارا به سرانجام میرسد.',NULL,NULL),(230,'radio_theatre',NULL,NULL,100000,NULL,NULL,NULL,NULL,NULL),(231,'radio_theatre','عروسی داریم و عروسی',0.65,200000,25,NULL,'کاپیتان شروع بزرگ خوشحالم بهترین.\nطلسم چوب بزودی. گاو گروه عنصر.\nپنجره پوشش او مطالعه صورت مرگ. خشک قایق فرار مزرعه شمال ستون موضوع. یافت شکل رویداد تمیز اصلی دشمن.','ساده ساعت نقطه درست ویژه بهترین. ابزار کار عمومی ترس نرم بازی شکل رشد. طبقه سرد کودک خرید استراحت سه باد.\nبیشترین ضربه تعداد ده نوع. سر باد باید قراردادن کودک کشش درمورد.','نمره علاقه تازه تحمل گام تازه. سبز زنده خانه پسوند دو جرم چه. بودن موضوع یادداشت سهم توسعه.'),(232,'radio_theatre','گوریل',2.49,120000,25,9,'مدت قرمز وحشی کودکان فرم همیشه اجازه. بسیار بدن صدا منطقه رهبری. ماده سفید در‌صد بخش پایین بزرگ ظهر نظر. هجاز طبقه گل شیشه‌ای آن زیادی.','خانه چاپ ملودی بین درمورد. سریع خاموش بخش یافت پسر.\nهزینه رکورد روند کشیدن. تعداد آفتاب زمین نظر ملاقات. باغ پنج سوراخ خاموش هیچ.','تخت خیابان گل عمل تماشای آمده چینی. نکن مو این‌ها دلار دوباره.\nگرفتن شروع دارند بیشترین شهرستان. اردک بدن رفت بسیار. از همچنین دست صندلی.\nگربه بگو تفریق فریاد. ایجاد شش کامیون ماشین برابر هیچ.'),(233,'radio_theatre','مرگامرگ',1.43,120000,NULL,9,'محافظت شکست ابزار ازجمله ملاقات سوار دیگر. عرضه حزب مبارزه انجام اتم.\nشهرستان پاسخ پوشش خوب فعل علت. تخت روی قرن پا آن شب. صنعت حشرات کنند محل. هزینه بهترین پاسخ ابزار نه تقسیم کامل بود.','رشته سنگ افزایش لغزش. گام بود خوب کار سوال. مرگ شیشه‌ای جرم آمده. نزدیک لاستیک در ساحل اتومبیل سلول تنها تخت.','چربی تجارت از. تعیین تر تجارت. انرژی را زیبایی صفحه.\nسوار اضافه دفتر دست زنگ کتاب دوره. جوان زمستان پر درجه. گرفتن عادلانه مانند شامل. راهنمایی قرمز می‌دانم بیت سریع مدت رشد.'),(234,'theatre','مرثیه ای برای کلمات',0.79,100000,15,NULL,'قایق بانک هرچند سرباز. یافت چگونه بوی گرم کودکان دشوار.\nنه حزب درجه مورد دور در لبخند. یا خریداری تحریک آرزو سگ.\nتحمل هر بخش خاموش. شخصیت واقع ماهی مانند زنان.\nکار صحبت خوب صنعت. سریع کامیون چشم راه.','بخش موتور ماشین. راه صبر پشتیبانی پرنده.\nسخت شروع طولانی. انجام مردم توسط دیوار شکار همیشه. خدمت شانه مهارت هواپیما.\nامیدوارم سوم آهنگ یخ تک اجازه. نقطه برش رنگ که.\nچربی زیبایی طبقه روند هزار.','اجرا رو مشترک می‌خواهم. فروش سهم نوشت آن‌ها. موسیقی ظهر توصیف قدیمی بنابراین صد اهن آموزش.\nزبان صورت بود مانند.\nرفته دختر شیشه‌ای بالا بخش ثابت شامل. جوان آرام آن قرمز علت ترس جوجه. بسیار ما سرد.'),(235,'theatre','اژدهاک',1.53,120000,10,NULL,'ذخیره شروع سمت سلول جنوب از. عادلانه علامت پرتاب خود لیست تشکر توسعه. اماده کم کراوات همخوان دریافت تخت.\nبازی تماشای شی این کنترل. خود دارند کاملا ظهر. موفقیت بخش خواهر عبور همه سیستم.','سر نقطه انسانی خوراک واکه. کلمه حتی رنگ اتصال خدمت رقص همسر.\nبلوک قرن پایان مشغول کلید. بالا نامه گرم سریع کوه. باز جمعیت پرنده نمایش دانه.\nاگر حزب سهم فروش مخلوط شانس. زمین شاخه متوسط شمال.','صندلی باید اجازه بله کارشناس بخش پنبه. آسمان لحظه‌ای در‌نظر مادر کوه جریان ورق. متوسط نوع کشیدن.\nشکل بگو اضافه با دفتر. ممکن صدای جنوب پر دوباره سن الگوی. رو فوری این‌ها تعیین زمستان دکتر مبارزه.'),(236,'radio_theatre','خاکستر به خاکستر',1.87,160000,NULL,NULL,'پنج بسیار درجه اماده. تشکر جنگل تماشای برق لیست کاملا.\nطلا لذت عجله‌ای موضوع غرب درمورد. مرکز هواپیما تاریک را وجوددارد.','تمیز موفقیت آماده فرار لوله. شانس جاده معمول می‌توانید مشغول بوی کوتاه. پنبه سال پوست سنگ.\nدوستان داغ صدای موفقیت همیشه. ابزار ما شش حیاط اما مدت.','ذهن فصل توصیف پنج دره آخرین. سخنرانی ساخته آشپز شهر مشاهده خنده.\nدروغ مانند طول همیشه چهار جا کم اتم. اشتباه اثر دوستان ازجمله قرار که ببینید.'),(237,'theatre','اتاقی در هتل پلازا',1.71,80000,15,9,'ضرب می‌توانید سخت جوان هنر. موفقیت دوم حکم.\nسیستم واقع گسترش نقشه ماه بود سفر. مرده هم زنان سن.\nسیاره طول ایستادن هر قدیمی. ما بزرگ تمیز یا در لبخند هردو.','شروع این حیوانات آن روی. دربرابر گاو ماه دست گسترش ستاره می‌کند.\nیک خوشحالم ترک سر سرباز. همیشه وزن چربی.','هرگز موضوع گفت مقاله. حاضر جاده کنند تکرار بزرگ آرام.\nسرمایه مطبوعات وزن ساخت ترک زمین. پیش دایره واقعی کشتن بگو حکم.\nهمچنین نه پشتیبانی بزرگ منظور دروغ بعدی غالبا.'),(238,'radio_theatre','ملکه چهارم آگوست',2.35,200000,NULL,NULL,'رنگ لیست شیشه‌ای حاضر نگاه نازک احتمالی. خشک اسم بوده زیادی.\nپیش پهن صدای لبخند مشترک. علت خواب بخش پوند مانند نکن رنگ ضخامت. تفریق خوبی دلار. عمیق خاص هر.','باصدا تیز تر بزرگ عبارت مراقبت. کامل زنگ کمک دست رشد سرمایه موقعیت.\nرکورد راه نمایش کوچک هزار نور. آزمون بینی میلیون. بانک شستشو شامل نازک تخت مناسب بیست. زمین کلمه مثلث معمول عجله‌ای شانس سعی‌کنید.','علامت شیشه‌ای شاخه رول مرده. می‌تواند سرباز بازدید اطلاع تمام.\nروش اجازه استخوان سن. پسر غالبا هفت نه ایده ویژه. سقوط آه مستعمره بپرسید هرگز.'),(239,'radio_theatre','فیکتیشز',1.65,200000,25,9,'رویداد سال مانند ماه مبارزه پایین. هزار مادر فروشگاه مستعمره بپرسید برادر تیز. شنبه باور سلول تجربه کنترل.\nمقاله جوجه باهم واکه. حکومت کوچک نه نور.','به دارد اقامت ایستادن سریع اقامت غرب خاصیت. دامنه آورده ساحل خوردن عرضه. چمن نه مدرسه ساحل آموزش.\nهمیشه شکار اتصال خود جدول. خاموش کمترین مانند گرفتن. من از جوان سخنرانی بخش.','صورت جریان طبیعی خشم حکم بالا زمین. شامل متفاوت زنان. تنها صحبت مثال سگ.\nخانم حشرات عنوان فوری قانون پسر. بعدی دنبال علم دارد. بله دوره دره قایق.'),(240,'theatre','اندر حکایت کباب سلطانی',2.23,150000,25,9,'وجوددارد پول کنند تیز بزرگ. چمن بیابان پهن سرد.\nکند تخت در الگوی سیاره که همسایه. دایره می‌توانید کمتر فروشگاه. داغ ذرت داغ فروش تیم زیادی دقیق. ورزش کارت ستون تیم احساس سطح فصل.','متولد موج پول پنجره. بهتر درخشش اوایل واکه ترتیب ذرت خوبی.\nقادر فریاد دقیق. خطر ماهی دیوار اقامت خاکستری ذخیره.\nنقطه پشتیبانی عمل عرضه افزایش شهرستان. نمره علامت وزن مستعمره کوچک رفت بادبان.','مرد جوجه منطقه پا دندانها. سعی‌کنید اصلی خانم صورت را شود گسترده. ده حلقه میوه بد.\nرکورد آن قرن اصلی اماده اره. عبور اتاق بین تحمل سنگ گسترش علامت. را کوارت ساعت مزرعه پنجره ذخیره.'),(241,'theatre','تروما',0.84,160000,10,9,'اصلی ویژه اماده آبی آورده حشرات بخار. دقیق تپه بالا ملودی فولاد است رایگان.\nپسر بین فرم چه بهار خواهر به‌عنوان. افزایش میلیون روشن اضافه شان. مادر سیستم مراقبت بزرگ تغییر بزرگ پول.','شش مربع تکرار باید عمل پوشاندن.\nزنگ روش محصول حلقه پا گوش. مراقبت اهن بازی آرام را هم آسانسور. ایجاد محصول یادداشت شستشو دیگر با توقف همچنین.','قانون عمیق ظهر و. ایده باید رشته خانه اولین. بخش گذشته آمده زبان.\nکار پوشش بند دریافت. ساده قایق شمار. واقعی شاخه کپی پایه است. مربع لازم فعل.'),(242,'theatre','اتاق خاکستری',1.70,120000,NULL,9,'خوبی روستای تعداد نیم کم کم. خواهر گرم مستعمره در‌نزدیکی. هزار رایت پایان بسیار ظهر.\nآن چشم کنترل آسمان نیروی نوشت. پوشاندن ساعت همخوان هجاز گسترده خاکستری انسانی.','جمع دریا ورزش میوه جوان خطر موج. را زمین خوب نهایی چه. راست بزرگ پا سنگ چه زبان.\nبرنده مورد علامت کاپیتان. قاره رنگ گاو اوایل شب.','هنوز گاو برخی آتش تماس. هیچ شرایط نماد مزرعه ستاره اتصال. سطح پشتیبانی قند گردن.\nپا بهترین پوند نه نقره‌ای. مالیدن ماه آبی می‌کند سخنرانی. حرارت دلار کوه عبارت.'),(243,'theatre','ماه تینار',1.30,120000,NULL,9,'رسیدن کامیون محصول قانون نور پیشنهاد مرگ. دور رول کند راهنمایی طولانی مولکول. نوشابه زنان درمیان همیشه.\nدشمن دلار سگ دوره پا. دور پاسخ دره که ورزش بینی شرق.','پهن عضو اعشاری همسر ماه ریشه. حرکت در شکل دو برابر پشتیبانی مقیاس پنبه. اقیانوس نوع پاسخ همسر موسیقی جنوب پسر نوشت. دلیل او لیست هرگز می‌گویند لباس بررسی باز.\nتنها بسیار مناسب. بزرگ صندلی بسیار جنگ.','گسترده قوی دور نگاه اعشاری نرم. ساحل مشترک ذهن مادر حکم. نقشه ماشین شب نماد صلیب.\nعبارت برق وحشی چه. به پوشاندن دوستان کمترین. رئیس ساخت شب. این بار ما کامیون بود ترک استفاده.'),(244,'radio_theatre','مدار',0.96,120000,NULL,9,'انجیر کلاس یافت آفتاب مبارزه. یادگیری دلیل سریع رفته ایستگاه ارسال بوی ما.\nنور پهن شروع چوب اتصال جهان صبر. رسیدن عمل شیشه‌ای لطفا آرام. صدا فشار نرده خود الگوی اینجا دست.','الگوی چربی تخت رکورد.\nبرنامه مالیدن صندلی ذرت توسعه تماس لباس. بیابان دریافت عبارت مجموعه می‌توانید. بخار فرار ماهی آسمان اثر اردوگاه. زن شعر تشکر طلا منظور.','دروغ تجربه جلو بازی. در می‌دانم بازی خط کارت ترتیب. اتومبیل همسر زنده قرن طلا شمار. می‌گویند آفتاب دارند.\nچوب لحظه‌ای قدیمی بخش به کشیدن چند.'),(245,'radio_theatre','پیله',1.38,100000,15,9,'مهارت اسب جز نگاه اردک. عنصر قطعه لبه نقشه توافق. در‌صد است فولاد بیشترین سبز عمل.\nویژه سریع را کپی سطح رادیو. لازم فروش اما برابر دارند اینجا.','تعداد خوب بیت چهار ساعت طناب. پایان کافی مشترک حیوانات نقطه سطح ازجمله.','مرگ سرگرم جریان یافت مناسب تحریک ضرب نه. برابر همه علامت دارد باهم بخش فولاد. نظر فضا شش زندگی درجه توپ لاستیک. تن ردیف نه آشپز فروشگاه.'),(246,'radio_theatre','میلیاردرها',1.55,200000,15,NULL,'کنترل یا اضافه آرام صعود سرد. مثلث ساعت سر سر خوشحالم پوست کامل.\nیا واقع ما ما تن شستشو. باران چه ما عمل سر جوجه.','دریافت فولاد ساخت نقره‌ای نه سرعت قایق. استخوان بال فقط جمعیت. هنوز طول یخ کند که پوشاندن.\nبخش ماده موضوع جریان صبح صد قلب.\nورزش آن اندازه جلو گفت:. کشور سمت اندازه موضوع روستای راست برق.','همسایه حوزه می‌گویند تفریق مخلوط بالا. ریشه آهنگ نمایندگی. قدیمی متوسط مولکول عزیز مقیاس.'),(247,'radio_theatre','فرش ایرانی',1.41,80000,10,9,'مطرح عجله‌ای مردم عضو فروش. گوشت ستاره خاکستری مشترک کلاس جعبه قرمز. صدا آموزش برش تحریک.\nنوشت معمول کلاس بحث انگشت بیشترین.\nفروش پا کوه گروه. ملودی ایده بسیار پایان تصویر هم.','پدر گاو نور. حکم ما زنان بود. مطرح پدر رایت آورده چربی هر.\nجوان سال راه. خاموش توسعه روستای فعل رویا او باور. پر مبارزه پوشاندن اندازه دنبال لاستیک.','برق لباس تقسیم ترک هفت. بزرگ خدمت بله چگونه خاموش دندانها دختر رنگ.\nساعت اب پیشنهاد قبل تمیز بود. خانه گذشته تاریک. یادگیری محل آرام می‌گویند او.'),(248,'radio_theatre','اشطباهی',1.22,100000,15,9,'زیبایی درمورد لذت شکل علامت روشن. کوتاه فرم کلاس غنی بنابراین انرژی فروشگاه. هر تجارت شن پرتاب ریشه کنترل خاصیت.\nجوجه بادبان سعی‌کنید معین شانه. سطح اجازه سن آه اینچ رو.','بخار پایان نه نمایش گوشت. بزرگ خفاش مخلوط دست شیر آه. لباس جریان می‌خواهم تعجب محل یادگیری ارزش.\nدارد همه قوی مبارزه وجوددارد انرژی. سوراخ قدرت دور ایستادن جز. پسوند حزب راه واکه تمیز هیچ.','شیشه‌ای پنج رویداد برابر. حکومت را آهنگ اگر وحشی خانم. خنده بینی اره واقع می‌خواهم ضخامت.\nما دوباره دهان سوار نوشابه موج ادامه. افزایش درمیان خاک اگر شارژ چند چشم.'),(249,'theatre','سوگواری در خیابان',1.56,120000,15,NULL,'نیاز سطح منطقه مشکل روند جاده یا. ترتیب صورت برنده بسیار بخار و آهنگ زمستان.\nسرگرم تغییر تجارت اسلحه عادلانه و. ثابت گفت آسان ضعیف.','گروه فروشگاه قدرت بزودی تخت سوال. نیاز گفت ساخت پرنده ملاقات مورد جهان. ما تقسیم تنها رفته پاسخ. سه دکتر اضافه بپرسید بلند.','جدید پشتیبانی موسیقی صدای خواب. تا واقعی شرکت خاص.\nاستفاده حتی شان کلاه جستجو. گوشه را دندانها مشکل قدرت ساخته کلمه ده. فقط ابزار لازم.\nبرابر سرد آزمون هزینه خانواده.'),(250,'theatre','لطفا بیدارم نکنید',2.03,100000,10,9,'تعجب چینی توصیف بودن. نرم بینی آمد مرده حتی معمول صورت.\nگفت بار دقیق تابستان لحظه‌ای اقامت برای. صدای دست بلوک بندر درست ما تشکر ویژه.\nفرم ردیف دوباره به‌عنوان. شاخه بود ثابت علامت صفحه آه.','رفت بلند باید گوشه ایستادن. نقره‌ای ادعا نمد مردم نمره. برادر هفت نماد تیز مردم پوشاندن. سوار انجام حرکت از.','بحث مدرن دیگر شنبه شرق انجام. هر دو غرب اتومبیل دارند.\nدریاچه تفریق منطقه. بازار بندر برادر شروع صندلی.\nرسیدن خاکستری شب گوش شمار کنید سخنرانی. بازدید یک نظر جریان کشور اماده. عمیق طناب پا چرخ برف.'),(251,'theatre','ضیافت شام برای احمق ها',1.67,150000,15,NULL,'ضربه کم بقیه می‌توانید پایان برف موفقیت خرید. مدرن کلاس کوه سرمایه مالیدن مولکول مولکول.\nعمل او مثلث مشابه. بله معین خشم قرن قراردادن ما. به‌عنوان یا متولد معامله.','از اره کافی ارزش. اواخر نقشه پهن آورده دانه اجازه استفاده.\nلطفا تجارت همان سگ مرگ روی. سن عمیق طلسم بالا آورده بوده.\nمرگ نوشابه خانه داستان دوباره پا نوشابه.','می‌تواند لغزش کمتر تماس پسر.\nگذشته حوزه آسان قلب تقسیم. بود تر سطح مایع.\nمرده دور آموزش خواب. برادر معین اتم ممکن دارند سخت اتم. ازجمله نهایی مناسب دهان. خوبی شیشه‌ای تحمل سیاره جنگل زمین گل.'),(252,'theatre','خاطرات خانه ای که نیست',1.47,80000,15,9,'مردها پدر پول دریافت اقامت بخش هر. کشیدن بررسی اساسی قایق نزدیک عمل پایه نیروی. در نازک درب هر زبان زمین.\nخنده سهم طناب اتومبیل. متوسط شانه عمومی راه.','سال آهنگ مطرح شی بنابراین سر صدا. عبارت فریاد بینی. ایستادن لحظه‌ای سریع آموزش فعل خانم پنبه همیشه.\nمن صعود محافظت رقص.','اهن تعداد در خفاش. در کامل بخش روشن خاموش.\nدقیقه ازجمله دارد می‌خواهم. ارسال نمک یافت مرگ سوراخ همیشه.'),(253,'theatre','خرس',2.32,160000,NULL,9,'قانون انتظار اشتباه شکل. شهر ازجمله شکل زمان اکسیژن.\nبرف همسایه دکتر بیابان واحد ارسال لباس.\nمرد نمره صد آتش. معامله عمل خوب. تابستان پیش او دلار نوع شمال دلیل.','صدای لیست کارخانه رنگ شمار.\nکشور لباس آمد بله مستقیم دلیل چینی. ضعیف صد آسانسور شمار دست چند بخش شما. فکر پا آموزش فقط جداگانه خانم خانه. کمی سقوط سفید دنبال سعی‌کنید کم اوایل ذهن.','پدر مزرعه ماشین انجام. ارسال مسابقه هوا لذت منطقه کامیون پنبه.\nما رودخانه کارخانه زمان دشوار کافی پسوند. را بسیار ساعت. ویژه عمیق در‌نظر رو. شنیده نه مشکل ماه شود رفت خاص.'),(254,'theatre','آنتیگونه',2.02,80000,10,NULL,'مرگ عادلانه استراحت دروغ گسترده دریافت. گرفتار در عرضه نگاه اتصال نماد. گفت: افزایش شکار شامل حرارت چهار اصلی هواپیما.\nقطعه مطمئن اتومبیل این‌ها حمل تعداد سنگ.','بهتر اولین ورزش کمک. توسط عرضه آسان آرام مستقیم برنامه صفحه.\nفروشگاه کفش حشرات پرداخت شکار روش واکه. همچنین روستای حرکت انسانی. قلب چهار کلید خوشحالم خطر.\nجوجه چگونه باید شرایط انسانی دانه دامنه.','افزایش جعبه نور. استخوان پشتیبانی تعیین خوب پاسخ استراحت. محل تحمل ناگهانی نقره‌ای دربرابر بینی فلز اطلاع.\nنان نقطه اسب پایان باصدا طولانی. طبیعت علامت مردها حتی دقیقه می‌گویند رویا مایع.'),(255,'theatre','هملت',2.24,200000,25,9,'قانون ساعت رئیس خاص هشت مرگ نور. مزرعه نه که گذشته.\nحزب بخش تعداد منظور در. کوارت صدا نزدیک پوشاندن.\nچشم جنوب هوا کشتن انسانی باور تابستان طبیعی. بیست گفت: به کم نمک غنی خدمت.','همه اتاق نمک. بوی ناگهانی قلب را خوبی.\nاتاق مقاله صلیب مالیدن احساس تقسیم برابر. مالیدن هوا ماده درخت از. هوا میلیون تر.','رایت بد اصلی قانون قلب کار خانم باز. لاستیک موضوع کمک کراوات جهان روی. کاپیتان بند دم رفت مرکز کشتی.'),(256,'theatre','باغ وحش شیشه ای',2.31,160000,15,NULL,'سرد موج که پیشنهاد یادگیری تماشای. نرده سطح شکل دو گسترده کمترین.\nدر‌صد دور دست به‌عنوان. زمین هوا بپرسید ترک داغ. گام رشد پوسته قوی خوراک فروشگاه بانک حرکت. گرم می‌توانید کنید تیز دو اشتباه.','ما ارسال در فروش زن. رفت آمده دو پایین دریاچه دفتر.\nایجاد چشم کامل روی زمین هواپیما بیست.\nعلامت در ماده زمین. دختر ساخته طبقه لباس طناب بیابان نزدیک.','باد مثال بنابراین پست کتاب. مناسب ترس آشپز اردک کلاه عضویت.\nبادبان او رهبری کودکان بهترین.\nمحل سهم پا سیم طولانی.'),(257,'theatre','سلام خداحافظ',2.41,150000,NULL,NULL,'شاخه مستقیم اجازه سبز دهان ضرب. بود توسعه صدای گوش سیستم گام.\nتعجب قوی زمین نیاز هنوز عضو نوشت. مشکل شارژ شاخه بادبان. معمول ساده مادر شب.','در عمومی نمودار کلید سوراخ خنده. خوردن اندازه تصویر فروشگاه خوب. خانه جمع اطلاع باور نوشابه شروع. نمد موتور اقیانوس حیاط سوار ذخیره توقف.','که نه اولین لباس دروغ تماس برنامه. همه شهر گروه صبح. کامل آه صلیب. پادشاه شستشو هنر لطفا چاپ قانون.\nصنعت ورزش اثر شرایط رایت میلیون. ضعیف ساعت صبح دشمن دیگر چند.'),(258,'theatre','بی خبران حیرانند',1.18,100000,25,NULL,'نوع فعل نهایی چه گسترده. هر تمیز که منظور دلار. ساحل دیگر بپرسید مردها نه.\nتعیین طبیعی سریع ذخیره ورزش این. کت متوسط آموزش دایره سقوط.','همان تشکر کشیدن اکسیژن حلقه در جرم. بازی باید را دیوار گوش یخ.\nهمیشه کمترین سر بیت. سبز صبر بیابان او صندلی میوه قطعه. زمان رهبری انرژی پا هنوز شان وتر.','چه سوم دایره شنا داغ. سمت کارشناس خریداری علامت خواب.\nدشمن خط میوه مولکول. ثابت کامیون عادلانه دقیق تک حیاط اتم.\nمحصول پایه اقیانوس انجام ویژه طناب سیب. را کارت کاملا. دلار دفتر ویژه نازک.'),(259,'theatre','دوزخی ها',0.82,150000,NULL,9,'مناسب گوشه عضویت علم فعل سه سریع. شکل یا جداگانه بازار. تخت چینی شش ساخته. سقوط با ارسال.\nپایان آن‌ها هزار گردن به حیوانات. تر اردوگاه بلوک بار فصل پایین.\nشهر خاص کلمه کوچک اکسیژن زیادی کت بهترین.','سخنرانی سرمایه خطر غنی طبیعت. اوایل چوب چاپ واکه عبارت. ساخته طبقه ماه گروه. تغییر زمین رشد.\nآسانسور تفریق اما رقص بود.','می‌توانید ادامه باید. صد نهایی واحد هنر نفت سعی‌کنید طولانی. بزرگ رودخانه آتش که تر مخلوط.'),(260,'theatre','یونسکو شدن',1.51,100000,15,9,'کودک دایره هنر. فعل معروف اصلی کشتی جعبه مقاله.\nلغزش طبیعی کارخانه خود البته سیستم. ستاره هر دندانها بزرگ لبه. مستقیم ما صد بسیار.\nچشم جا آخرین. وحشی درایو شروع کارخانه دست مسابقه قدیمی چه.','برابر ماده بعدی خاصیت پرداخت خاک روند. وحشی فرم رسیدن دست نه مشابه رویا اتم.\nانجام قرمز خود فلز نمد توسط.\nکافی که هنوز اولین جستجو وزن بازار. تکرار کمتر زرد. اقیانوس روش معین.','سخنرانی می‌توانید تمام فروشگاه جوجه که. کارشناس بهار پست.\nجدید دیگر که درجه.\nکلید اتاق مزرعه جمعیت خشک رایت طلا دره. کتاب نفت کشیدن دریا خواب نمک گربه.'),(261,'concert','گروه عشاق',2.37,550000,NULL,9,'باور انرژی برف گروه دست بله. پرواز طبیعی ترتیب سخت از.\nقدیمی شعر عمومی ضخامت لوله در. بزرگ تجربه سرد شیشه‌ای.\nقلب بینی گام دور. برادر البته مزرعه فضا پایین مجموعه. سفر عمل اضافه خوبی بیست.',NULL,'جوجه به دریافت. برف جدید ملایم علاقه عمل.\nاقامت آخرین کلاس حال کامیون لیست انگشت. جرم مشترک واحد گسترش معروف. قوی حزب هرچند خاموش بزودی.\nبسیار لغزش نمد بپرسید اتم نشستن. نازک سبز نه مرگ بهترین.'),(262,'concert','در پی آن آشنا',1.79,260000,NULL,9,'سیب مستقیم از همخوان. میلیون کودک بالا بلند.\nواقع نمک میلیون جنگل اردک روند. درب درخشش پسر سرباز بادبان.\nبلند عبارت چهار بقیه صحبت انرژی. را چرخ رفته ما کارشناس دهان روی.\nضربه راست سریع در چرخ.',NULL,'نگاه کتاب راست تحریک چه افزایش ساعت. گل خوب تکرار شب جاده کارخانه.\nکنید موج خاکستری خیابان. ابزار ما طبیعی کمی. خوب نمک دریافت گروه اشتباه سخنرانی.'),(263,'concert','گروه سینا ذکائی',1.71,180000,NULL,9,'انسانی خاکستری قانون ما هوا پنجره. پهن دور شکل بار پرواز پسر. شارژ از خوب ضربه عادلانه جریان بلوک. مثلث هم جعبه درخت صحبت.\nمی‌تواند هوا هر موفقیت.',NULL,'نمودار سگ ده لذت مطالعه آبی جوجه. دشمن ثابت دریا نمک.\nپرداخت هشت نفت ممکن گوش. را همان خفاش شکست آفتاب بند هزار. چگونه خانواده پرواز تکرار انجام اگر انتظار.'),(264,'concert','حسام آرین',1.68,380000,NULL,9,'هزار گسترش سرد کنترل. حلقه انتظار می‌کند. چ